import { styled } from "styled-components";
import SearchPopup from "../../components/Search/SearchPopup";
import Layout from "../../layout/Layout";

const Div = styled.div``;
const Search = () => {
  return (
    <Layout>
      <Div>
        <SearchPopup />
      </Div>
    </Layout>
  );
};

export default Search;
